import { findByLabelText } from "@testing-library/react";
import React from "react";
import { Link, useNavigate } from "react-router-dom";
import styles from '../styles.js';

export default function Header( { text } ) {


    const navigate = useNavigate();

    const logout = () => {
        navigate('/judge-manager/auth');
    };

    return (
        <div>
        <header style={styles.headerStyle}>
        <div>
            <button style={styles.buttonStyle} onClick={() => navigate('/judge-manager/app')}>Home</button>
            <button style={styles.buttonStyle} onClick={() => navigate(`/judge-manager/app/${text.toLowerCase()}`)}>{text}</button>
        </div>
        <div>
            <button style={styles.buttonStyle} onClick={logout}>Logout</button>
        </div>
    </header>
    </div>
    );

}
